Conditions on Approval:
It is a condition of this service approval that the Approved Provider:
•	Must employ or engage at least 1 full time equivalent family day co-ordinator for every 15 family day care educators engaged by or registered with the family day care service; It is a condition of this service approval that the Approved Provider:
•	Must only engage or register educators with the family day care service who provide education and care in Brisbane City Council, Ipswich City Council and Logan City Council local government areas. It is a condition of this service approval that the Approved Provider:  Must not engage or register more than 50 family day care educators with the service;

The CCTV and monitors installed at the service are constantly maintained and operational to ensure the facilitation of supervision of children at all times they are being educated and cared for at the service, having regard to the need to maintain the rights and dignity of the children as required under regulation 115 of the Education and Care Services National Regulations. The service is approved to provide education and care to children under two years of age on the ground floor of the service only At all times education and care is being provided to children in the roof top outdoor play area, at least two (2) educators must be working directly with the children and the service must also ensure it continues to comply with the educator to child ratio as outlined in the National Regulations on this level. As part of the requirement to conduct three (3) monthly emergency and evacuation procedures rehearsals in accordance with regulation 97(3) of the Education and Care Services National Regulations, the Approved Provider must, engage an appropriate expert such as a person/entity holding a QBCC license in emergency procedures, a fire safety advisor or fire safety engineer to observe and report on one rehearsal at least annually by the end of April every year. The Approved Provider must ensure that no outdoor play equipment is placed within one metre of the perimeter fencing in the roof top outdoor play area. A copy of the annual evacuation outcome report is to be supplied to the Regional Office of the Regulatory Authority in which the service is located within seven (7) days upon receipt of the report by the Approved Provider together with any proposed actions to improve evacuation procedures. CCTV cameras and monitors are to be installed, constantly maintained and operational in the service lifts and used to facilitate supervision.  A staff member must be engaged as a Transition Attendant between the hours of 7:30am - 5:30pm daily to ensure that children are safely and freely able to transition between the classrooms and the rooftop playground. The Transition Attendant:
▪ cannot be counted towards the prescribed educator to child ratio requirements;
▪ must be equipped with a ‘walkie talkie’ to enable communication with staff inside the service;
▪ must complete a sweep of the area that the children transitioned away from to ensure that no child is left behind The service must conduct attendance checks following transitions between the rooftop playground and classrooms From 1 March 2023, CCTV cameras with Artificial Intelligence (AI) capability must be installed and operational on the rooftop playground at all times having regard to the need to maintain the rights and dignity of children as required under regulation 115 of the Education and Care Services National Regulations. The AI technology must use an application to notify staff when a person is detected on the rooftop during periods that the rooftop playground is not in use The Transition Attendant must be equipped with a dedicated device with the AI CCTV application installed and with notifications enabled, once this technology is operational. From 1 April 2023, the service must conduct unannounced compliance audits of the Multi-Level Services Transition Procedure on a quarterly basis. Records of these audits must be kept and made available for inspection by the Queensland Regulatory Authority. The service is approved to provide education and care to children from birth up to and including over preschool age This service is not approved to provide education and care to school children

