i.	As part of the requirement to conduct three (3) monthly emergency and evacuation procedure rehearsals in accordance with regulation 97(3) of the Education and Care Services National Regulations, the Approved Provider must engage an appropriate expert, such as a person/entity holding a Queensland Building and Construction Commission licence in Emergency Procedures, a fire safety advisor or a fire safety engineer, to observe and report on one full rehearsal by the end of March each year;
