This service is approved to provide education and  care to children from birth up to and including school children. At all times that children are transported in a vehicle there is to be an additional educator above the educator to child ratios prescribed in the Education and Care Services National Regulations 2.	The following steps are to be taken each time children are transported in a vehicle:

i.	A roll call is to be completed as children enter the bus;
ii.	A roll call is to be completed once the bus returns to the service;
iii.	A roll call is to be conducted once the children enter the foyer of the service;
iv.	A physical check of the bus is to be completed after each time children are transported.

